import Head from 'next/head';

import Menu from '../components/Menu';

import { Container, Jumbotron, Form, FormGroup, Label, Input } from 'reactstrap';

function Home() {
  return (
    <>
  <head>
    <title>Contato - Celke</title>
    <meta name="description" content="Contato com a empresa..."/>
    <meta name="author" content="Eu"/>
  </head>
<Menu />
<Jumbotron fluid className="descr-top">
  <style>
    {`.descr-top{
      background-color: #000;
      color: #fed136;
      padding-top: 100px;
      padding-bottom: 50px;
      margin-bottom: 0rem !important;
    }`}
  </style>
  <Container className="text-center">
    <h1 className="display-4">Contato</h1>
   

  </Container>
</Jumbotron>

<Jumbotron fluid className="form-contato">
  <style>
    {`.form-contato{
      padding-top: 80px;
      padding-bottom: 80px;
      background-color: #fff;
      margin-bottom: 0rem !important;
    }`}
  </style>
  <Container>
    <form>
      <FormGroup>
        <Label for="name">Nome</Label>
        <Input type="text" name="name" id="name" placeholder="Nome Completo" />
      </FormGroup>

      <FormGroup>
        <Label for="email">Email</Label>
        <Input type="email" name="email" id="email" placeholder="Digite seu Email" />
      </FormGroup>

      <FormGroup>
        <Label for="subject">Assunto</Label>
        <Input type="text" name="subject" id="subject" placeholder="Assunto da Mensagem" />
      </FormGroup>

      <FormGroup>
        <Label for="content">Conteúdo</Label>
        <Input type="textarea" name="content" id="content" placeholder="Conteúdo da Mensagem" />
      </FormGroup>

      <button type="submit" outline color="warning">Enviar</button>

    </form>
  </Container>
</Jumbotron>

</>
  );
};

export default Home;
